import React from 'react';
import SovosFlatButton from 's1-ui/sovos-flat-button';
import "../taxCalculator.css"

const style = {
    headerType: {marginBottom: "20px"},
    bottomType: {marginTop: "20px"}
};

function ActionBar({ className, onReset, isHeader }) {
  return (
    <div className={ className }>
      <div style={ isHeader ? style.headerType : style.bottomType } className="comment--table">
        <SovosFlatButton>OPEN</SovosFlatButton>
        <SovosFlatButton
          type="submit" className="save">SAVE</SovosFlatButton>
        <SovosFlatButton
          type="button"
          onClick={ onReset }
          className="clear">CLEAR</SovosFlatButton>
        <SovosFlatButton className="calculate--tax">CALCULATE TAX</SovosFlatButton>
      </div>
    </div>
  );
}

ActionBar.propTypes = {};
ActionBar.defaultProps = {};

export default ActionBar;
